    public void finArchivo(){
        try{
            // poner el codigo de finalizacion

            writeLine("mov eax, 1", 0);
            writeLine("xor ebx, ebx", 0);
            writeLine("int 80h", 0);
            writeLine("", 0);

            // escribir el segmento de datos no inicializados
            writeLine("SECTION .bss", 0);
            for(Simbolo s : tablaSimbolos){
                
                if(s.tipoSimbolo.equals("variable")){
                    SimboloVariable var = (SimboloVariable) s;
                    writeLine(var.nombre, 1);
                    writeLine("resb", 1);
                    String tipo = var.tipoVariable;
                    switch(tipo){
                        case "int": 
                            writeLine("4", 0);
                            break;
                        case "string": 
                            writeLine("2", 0);
                            break;
                        case "uint":
                            writeLine("4", 0);
                            break;
                        case "bytes":
                            writeLine("1", 0);
                            break;
                        case "bytes1":
                            writeLine("1", 0);
                            break;
                        case "bytes2":
                            writeLine("2", 0);
                            break;
                        case "bytes3":
                            writeLine("3", 0);
                            break;

                        default:
                            break;
                    }
                }
            }
        } catch(IOException e ){
            e.printStackTrace();
        }
    }

